import React from "react";
import classes from "./StaffSalary.module.css";
import ChartStaff from "../charts/ChartStaff";
import CriteriaSalary from "../criterias/CriteriaSalary";
import CriteriaViolations from "../criterias/CriteriaViolations";

export default function StaffSalary() {
  let staffData = [
    {
      name: "OB1CHAM",
      rank: "Модератор",
      mainSalary: 150,
      answerForum: 3,
      online: "21:00:00",
      additionallyOnline: "13:55",
      bonus: 200,
      totalWeek: 500,
      totalAllTime: 10,
      birthday: "3 сентября",
    },
    {
      name: "Rezorax",
      rank: "Модератор",
      mainSalary: 150,
      answerForum: 3,
      online: "21:00:00",
      additionallyOnline: "13:55",
      bonus: 200,
      totalWeek: 230,
      totalAllTime: 10,
      birthday: "3 сентября",
    },
    {
      name: "maxim332",
      rank: "Модератор",
      mainSalary: 150,
      answerForum: 3,
      online: "21:00:00",
      additionallyOnline: "13:55",
      bonus: 200,
      totalWeek: 455,
      totalAllTime: 10,
      birthday: "3 сентября",
    },
    {
      name: "niki22ki",
      rank: "Модератор",
      mainSalary: 150,
      answerForum: 3,
      online: "21:00:00",
      additionallyOnline: "13:55",
      bonus: 200,
      totalWeek: 460,
      totalAllTime: 10,
      birthday: "3 сентября",
    },
    // {
    //   name: "Rumkov",
    //   rank: "Модератор",
    //   mainSalary: 150,
    //   answerForum: 3,
    //   online: "21:00:00",
